import ADD_PERSON_SUCCESS from '../action/types'
import ADD_PERSON_FAILURE from '../action/types'

const initialState = {
  setname: "",
  seturl: "",
  todos:[]
};

export default function todosReducer(state = initialState, action) {
  switch (action.type) {
    case ADD_PERSON_SUCCESS:
      return {
        ...state,
        todos:action,
        success: 'true'

      };
    case ADD_PERSON_FAILURE:
      return {
        ...state,
        failed: 'false'
      };
    default:
      return state;
  }
 }
